window.bookSummaryJSON = "<p><b>A dark shadow stretches out across the galaxy.</b> </p> <p>Evan and his friends find themselves victorious but at a cost. The robotic children have been forced into a corner, fighting for every scrap of space they can. The war is at a stalemate, neither side able to strike the final blow. </p> <p>As Evan plans his next steps, something creeps across the universe. A new threat, one that the Children are all too familiar with, makes itself known with deadly consequences. Just as one war is ending, another begins, and Evan finds himself thrust back onto the frontlines. </p> <p>Evan and his fellow humans will need to deploy new units and strategies if they plan on surviving the opening salvos of the Biowar! </p>"; 
